import React from "react";
import { Route, Link } from "react-router-dom";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <nav>
        <Link to="/">Actors</Link>
        <Link to="/currencies">Movie-Ideas</Link>
        <Link to="/currencies">Movie-Notes</Link>
      </nav>
    </div>
  );
}

export default App;
